import Button from './Button'

const courseHeader = ({ onAdd, showAdd }) => {
    return (
        <div className='courseheader'>
            <h1>List of Courses</h1>
            <Button color={showAdd? 'red': 'green'} text={showAdd? 'Close': 'Add'} onClick={onAdd}/>
        </div>
    )
}

export default courseHeader
